import { NextComponentType } from 'next';

interface HomeInitialProps {
    name: string
}

interface HomeProps {
    router: NextRouter;
    url: Router;
}

const Home: NextComponentType<any, HomeInitialProps, HomeProps> = (props) => {

    console.log('props render ... ');
